import React from "react";

export default function section() {
  return (
    <section className="most-picked">
      <div className="container mx-auto">
        <div className="text-blue font-sans font-medium text-2xl">
          <h1>Most Picked</h1>
        </div>
      </div>
    </section>
  );
}
